                    sigma(:,:,1),sigma(:,:,2),dSigma1dG,dSigma2dG,...
                    dv1dG,dv2dG,mu(1,:),mu(2,:),alpha,dataweight); 

                dlossdS = KLlossds(datamu1,datamu2,datasigma(:,:,1),datasigma(:,:,2),...
                    sigma(:,:,1),sigma(:,:,2),dSigma1dS,dSigma2dS,...
                    dv1ds,dv2ds,mu(1,:),mu(2,:),alpha,dataweight); 

                dlossdd = KLlossdd(datasigma(:,:,1),datasigma(:,:,2),sigma(:,:,1),sigma(:,:,2),...
                    dSigma1dd,dSigma2dd,mu(1,:),mu(2,:),alpha,dataweight);

                lambda = 1e-6;
                lambdaG = 1e-6;
                lambdaS = 1e-6; 
                lambdad = 1e-6;

                 g1 = max(g - lambda*dlossdg,zeros(N,1)); 
                 G1 = max(G - lambdaG*dlossdG,zeros(N,1));
                 S1_vec = max(S(:,1) - lambdaS*dlossdS,zeros(N,1)); S1 = S1_vec*ones(1,N);
                dd1 = max(dd - lambdad*dlossdd,0);

                alphaold = alpha; gold = g; Gold = G; ddold = dd; Sold = S;
                g = g1; G = G1; dd = dd1; S = S1; 
                ourloss(no,sample) = loss;
                ourmu{no,sample} = mu; oursigma{no,sample} = sigma;
                ourg{no,sample} = g; ourG{no,sample} = G; ourd(no,sample) = dd; ourS{no,sample} = S;
                no = no+1;
    
            elseif iter>1
                dalphadg = zeros(length(alpha),length(g));dalphadG = zeros(length(alpha),length(G));
                dalphadS = zeros(length(alpha),length(S));dalphadd = zeros(length(alpha),length(dd));
                for rr = 1:length(alpha)
                    for ww = 1:length(g)
                        if gold(ww)~=g(ww)
                            dalphadg(rr,ww) = (alpha(rr)-alphaold(rr))./(g(ww)-gold(ww));
                        end
                        if Gold(ww)~=G(ww)
                            dalphadG(rr,ww) = (alpha(rr)-alphaold(rr))./(G(ww)-Gold(ww));
                        end
                        if Sold(ww)~=S(ww)
                            dalphadS(rr,ww) = (alpha(rr)-alphaold(rr))./(S(ww)-Sold(ww));
                        end                
                    end
                    if ddold~=dd
                        dalphadd(rr) = (alpha(rr)-alphaold(rr))./(dd-ddold);
                    end
                end
                dlossdg = KLlossdgnew(datamu1,datamu2,datasigma(:,:,1),datasigma(:,:,2),...
                    sigma(:,:,1),sigma(:,:,2),dSigma1dg,dSigma2dg,...
                    dv1dg,dv2dg,mu(1,:),mu(2,:),alpha,dataweight,dalphadg,lambda_penalty); 

                dlossdG = KLlossdG2new(datamu1,datamu2,datasigma(:,:,1),datasigma(:,:,2),...
                    sigma(:,:,1),sigma(:,:,2),dSigma1dG,dSigma2dG,...
                    dv1dG,dv2dG,mu(1,:),mu(2,:),alpha,dataweight,dalphadG,lambda_penalty); 

                dlossdS = KLlossdsnew(datamu1,datamu2,datasigma(:,:,1),datasigma(:,:,2),...
                    sigma(:,:,1),sigma(:,:,2),dSigma1dS,dSigma2dS,...
                    dv1ds,dv2ds,mu(1,:),mu(2,:),alpha,dataweight,dalphadS,lambda_penalty);

                dlossdd = KLlossddnew(datamu1,datamu2,datasigma(:,:,1),datasigma(:,:,2),sigma(:,:,1),sigma(:,:,2),...
                    dSigma1dd,dSigma2dd,mu(1,:),mu(2,:),alpha,dataweight,dalphadd,lambda_penalty);
    
                if iter<5
                    lambda = 10^(-6); 
                    lambdaG = 10^(-6); 
                    lambdaS = 10^(-6); 
                    lambdad = 10^(-6); 
     
                else
                    lambda = 10^(-floor(log10(max(abs(dlossdg(:)))))-3.5); 
                    lambdaG = 10^(-floor(log10(max(abs(dlossdG(:)))))-3.5); 
                    lambdaS = 10^(-floor(log10(max(abs(dlossdS(:)))))-2.5); 
                    lambdad = 10^(-floor(log10(max(abs(dlossdd(:)))))-3);
                end
    
               g1 = max(g - lambda*dlossdg,zeros(N,1)); 
               G1 = max(G - lambdaG*dlossdG,zeros(N,1));
               S1_vec = max(S(:,1) - lambdaS*dlossdS,zeros(N,1)); S1 = S1_vec*ones(1,N);
               dd1 = max(dd - lambdad*dlossdd,0);
    
               alphaold = alpha; gold = g; Gold = G; ddold = dd; Sold = S;
               g = g1; G = G1; dd = dd1; S = S1; 
               ourloss(no,sample) = loss;
               ourmu{no,sample} = mu; oursigma{no,sample} = sigma;
               ourg{no,sample} = g; ourG{no,sample} = G; ourd(no,sample) = dd; ourS{no,sample} = S;
               no = no+1;
            end
         else
            sample = sample+1;break;
         end
    end
end

